CREATE DEFINER=`root`@`localhost` PROCEDURE `user_has_complete_vaxvax_record`(in user_id INT)
Begin
	select 
		user_info.first_name as 'Fully Vaccinated User, First Name', 
        user_info.last_name as 'Fully Vaccinated User, Last Name' 
	from user_info
	join vaccine on user_info.user_id = vaccine.user_id
    where vaccine.dose_num = 2 and  vaccine.user_id = user_id;
End ;;
